description:
London's Super Heroes have been vanquished. Only the Deadbeat Heroes can put an end to dastardly evil-doers and their rotten plans!
Deadbeat Heroes is a movement-based 3D brawler in which you dodge bullets, steal super powers and crack wise. You play as the new wave of ‘Deadbeat Heroes’. Not born with their own powers, they are armed with a super gauntlet and the ability to 'borrow' the powers of others. Vie to win the hearts of the public with your amazing derring-do, while not getting shot, sliced or lasered.



Features

Power Fists Forever - Choose from one of 10 explosive abilities including a rocket powered punch, freeze ray and invisibility&lt;br/&gt;

London's Streets - Over 35 levels set across London&lt;br/&gt;

Extreme Traversal - Wall Run &amp; Air Dash through London&lt;br/&gt;

Alone or with a Friend - 1 to 2 player local campaign co-op&lt;br/&gt;
